description:
Good Vampires battle Zombie Vampires while trying to hide their own identity and prevent the infection from spreading.

A group of Vamprie commandos tries to keep their identity secret, while trying to stop the spread of the infection. Soldiers from across the ages, it's up to these vampires to end the zombie infection...

